# Dptech FW1000 Firewall
start_mode: enable
hostname: dptech
line_feed: "\r\n"
modes:
  enable:
    prompt: "<{}>"
    switch_mode_cmds:
      - "conf-mode"
      - "exit"
      - "end"
    cmds:
      - cmd: "language-mode chinese"
        output: ""
      - cmd: "terminal line 0"
        output: ""
  config:
    prompt: "[{}]"
    switch_mode_cmds:
      - "end"
    cmds: 
      - cmd: "sysname dptech"
        output: ""
